WEAPON.GetName = function ( f139_arg0, f139_arg1 )
	local f139_local0 = Engine.CBBHFCGDIC( StringTable.DIFCHIGDFB( CSV.weapons.file, CSV.weapons.cols.ref, f139_arg0, CSV.weapons.cols.name ) )
	if not f139_arg1 or not f139_arg1.dataTable then
		return f139_local0
	else
		local f139_local1 = f139_arg1.dataTable
		if f139_local1.lootName or f139_local1.isCustom then
			DebugPrint( "Weapon Preview Film: blueprint name: " .. tostring( f139_local1.blueprintName ) )
			DebugPrint( "Weapon Preview Film: loot name: " .. tostring( f139_local1.lootName ) )
			return f139_local1.blueprintName and GUNSMITH.GetCustomModName( f139_local1.blueprintName ) or f139_local1.lootName
		else
			DebugPrint( "Weapon Preview Film: variant ID: " .. tostring( f139_local1.variantID ) )
			return f139_local0
		end
	end
end

